import '../../App.css';

export default function Statistics() {
  return <h1 className='statistics'>ΕΜΦΑΝΙΣΗ ΣΤΑΤΙΣΤΙΚΩΝ ΚΑΙ ΔΙΑΓΡΑΜΜΑΤΩΝ</h1>;
}
